import React, { useEffect, useState } from "react";
import axios from "axios";
import "./courses.css";

const CoursesCard = () => {
  const [productData, setProductData] = useState([]);

  useEffect(() => {
    const fetchProductData = async () => {
      try {
        const response = await axios.get("http://localhost:8000/api/products");
        setProductData(response.data);
      } catch (error) {
        console.error("Error fetching product data:", error);
      }
    };

    fetchProductData();
  }, []);

  return (
    <div className="flex flex-wrap justify-center">
      {productData.map((val, idx) => (
        <div
          key={idx}
          className="shadow-2xl border border-solid shadow-emerald-200 border-gray-500 bg-[#317e7e28] drop-shadow-2xl my-5 p-2 m-5 rounded-2xl hover:scale-105 hover:bg-[#00ffea28] duration-300 ease-in-out"
        >
          <div className="content flex flex-col justify-center items-center w-[50vh]">
            <div className="m-2">
              <div className="img">
                <img
                  className="h-[13vh] rounded-2xl"
                  src={val.imageLink}
                  alt={val.imageName}
                />
              </div>
            </div>
            <div className="text justify-center items-center flex flex-col">
              <div className="flex">
                <h1 className="flex p-2">{val.imageName}</h1>
              </div>
              <div className="details">
                <div className="flex justify-between flex-row my-5" key={idx}>
                  <div className="dimg mr-4">
                    <img className="h-[5vh]" src="" alt={details.name} />
                  </div>
                  <div className="para">
                    <h4>App Tech Tell</h4>
                    <span>{details.totalTime}</span>
                  </div>
                </div>
              </div>
              <div className="rate">
                <i className="fa fa-star"></i>
                <i className="fa fa-star"></i>
                <i className="fa fa-star"></i>
                <i className="fa fa-star"></i>
                <i className="fa fa-star"></i>
                <label htmlFor="">(5.0)</label>
              </div>
            </div>
          </div>
          <div className="justify-around flex-warp my-3 flex">
            <a href={val.link1} target="_blank" rel="noopener noreferrer">
              <button className="hover:bg-[#00e1ff3b]">About</button>
            </a>
            <a href={val.link2} target="_blank" rel="noopener noreferrer">
              <button className="hover:bg-[#00e1ff3b]">Road Map</button>
            </a>
            <a href={val.link3} target="_blank" rel="noopener noreferrer">
              <button className="hover:bg-[#00e1ff3b]">Other</button>
            </a>
          </div>
          <a
            href={val.youtubeVideoURL}
            target="_blank"
            rel="noopener noreferrer"
          >
            <div className="outline-btn justify-center items-center flex">
              START NOW!
            </div>
          </a>
        </div>
      ))}
    </div>
  );
};

export default CoursesCard;
